	(34738,X'687474703A2F2F747A626172616E6A652E6872','TuristiÄÂka zajednica Baranje','TZ Baranja','Obrubljena Dravom i Dunavom i podijeljena hrvatsko-maÃ„Â‘arskom drÃ…Â¾avnom granicom, na istoku zaÃ„Âarana moÃ„Âvarom, na jugu i jugozapadu zaÃ…Â¡tiÃ„Â‡ena rijeÃ„Ânim rukavcima, a na sjeveru i sjeverozapadu otvorena za povezivanje vinskim cestama i puteljcima - Baranja je danas i dalje vrlo zatvorena, gotovo izolirana i mistiÃ„Ânija nego ikada prije.','Bordered by the Drava and the Danube rivers and divided by Croatian-Hungarian state border, in the east charmed by a swamp, in the south and southeast sheltered by mouths of the river and in the north and northeast open for connection via wine roads and paths â€“ Baranja is even today quite closed, almost secluded, more mystical than ever before. Despite old bridges having been renovated and new ones being built, regardless of the fact that it is dappled with several international road routes and that it is becoming an ever more interesting tourist destination â€“ at this day Baranja manages to preserve a unique note since its people jealously keep their existential secrets. They strongly and clearly remember the tales older than their own families, secrets of life and survival, of love and dying, wines, hot peppers, special kind of fishing, weddings, buÅ¡e (traditional masks from Baranja), pudarine (guarding ripening grapes), pauniÄ‡i (embroidered motifs of small peacocks on traditional folk costumes), slamnjaÄe (straw beds) and i kandile (hanging candles). Owing to this still existent ethnographic magic which can be read from the faces of people living outside main roads, Baranja is capable of attracting, yet never revealing itself to the fullest.','Baranja, Seoski turizam, kontinentalni turizam, ruralna Hrvatska na jednom mjestu, kulen, vino, KopaÄki rit, Turizam, Baranja tourist board',0,0,0.83,1112,1,'Beata Kovac',X'696E666F40747A626172616E6A652E6872',X'39352E3137382E3135342E313733','2014-03-06',2,0,'2017-10-30